      | 48968 -> { ItemTypeData.id= 48968; name= "Deathglow Splendorcook"; published= false; description= "<b><color=yellow>Warning:</color> Currently Protected by Local Force Field Projector</b>    The Deathglow Hunters are probably the most grotesque and filth-encrusted gang of chem-cooking loons in all of New Eden. Their Deathglow Splendorcooks are high-ranking masters of the art of  cooking  Deathglow from the yield of Cthonic Attar their loathesome underlings bring them. The Splendorcooks are the source of the best refined Deathglow and ensure that the weird and vile boosters keep flowing from this illegal boosters ring into the underground markets of New Eden.    Tolerated by the Blood Raiders for the profits to be had from selling Deathglow, the gang is nevertheless regarded with disdain by the Covenant's regular  priesthood of all believers . CONCORD intelligence indicates that the Blood Raiders have recently developed synaptic acceleration technology using Deathglow, the street name for Chromodynamic Tricarboxyls: unstable, mind-altering chemicals that can be refined and processed from Cthonic Attar ores usually found only in intermediate deadspace zones."; marketGroupId= None; groupId= 1975; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 150.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 11800000.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 235.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 118000.000000 } |]; dogmaEffects= [|  |]; capacity= 235.000000; graphicId= Some(2795); mass= 11800000.000000; packagedVolume= 118000.000000; portionSize= 1; radius= 150.000000; volume= 118000.000000 } |> Some
