      | 54788 -> { ItemTypeData.id= 54788; name= "Brutix Capsuleer Day XVII SKIN"; published= true; description= "Capsuleers were given independent licenses 17 years ago and the YC122 celebrations mark this latest anniversary of the start of the Capsuleer Age with the opening up of New Eden's frontiers by immortal space pilots.    Capsuleer Day XVII is a moment of celebration for  The Elite  pilots even as the threat of invasion from the Triglavian Collective looms. CONCORD and the core empires of New Eden surely hope to persuade the ranks of independent capsuleers to join the struggle against the implacable and inscrutable foe."; marketGroupId= Some(1958); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
